import { Component, Prop, Vue } from 'vue-property-decorator';

@Component
export default class ListGroupItem extends Vue {
  @Prop() icon: string;
  @Prop({default: 'blue'}) color: string;
  @Prop({default: true}) justifyContent: boolean;
}
